        private void button1_Click(object sender, EventArgs e)
        {
            if (PS3.ConnectTarget())
            {
                PS3.CCAPI.Notify(CCAPI.NotifyIcon.INFO, "Successfully Connected To PS3");
                MessageBox.Show("Successfully Connected to your PS3 console!", "Successful", MessageBoxButtons.OK);
                string GetattProc = PS3.CCAPI.GetAttachedProcess().ToString();
                string FMWV = PS3.CCAPI.GetFirmwareVersion();
                string CPU = PS3.CCAPI.GetTemperatureCELL();
                string RSX = PS3.CCAPI.GetTemperatureRSX();
                string ConName = PS3.GetConsoleName();
                label1.Text = CPU;
                label4.Text = FMWV;
                label6.Text = RSX;
                label12.Text = ConName;
                label9.Text = "Connected";
                label9.ForeColor = Color.Green;
                button2.Enabled = true;
                button17.Enabled = true;
            }
            else
            {
                MessageBox.Show("Failed to connect to your PS3 console.", "Error", MessageBoxButtons.OK);
                label9.Text = "Failed to Connect!";
                label9.ForeColor = Color.Yellow;
            }
        }

        private void button2_Click(object sender, EventArgs e)
        {
            if (PS3.AttachProcess())
            {
                PS3.CCAPI.Notify(CCAPI.NotifyIcon.INFO, "Successfully attached to Black Ops II! Made by Alccx");
                MessageBox.Show("Successfully attached to Black Ops II! Made by Alccx", "Successful", MessageBoxButtons.OK);
                label8.Text = PS3.Extension.ReadString(0x026C0658);
                label8.ForeColor = Color.Green;
                string originalname = PS3.Extension.ReadString(0x026C0658);
                label10.Text = "Attached";
                label10.ForeColor = Color.Green;
                button4.Enabled = true;
            }
            else
            {
                MessageBox.Show("Failed to attach to Black Ops II!", "Error!", MessageBoxButtons.OK);
                label10.Text = "Failed to Attach!";
                label10.ForeColor = Color.Yellow;
            }
        }

